import logoSquare from '../assets/MoraDesignsAsset 4square.svg'

function Header() {
    return (
        <div>
            <header style={{display: 'flex'}}>
                <a style={{width: '30%'}}><img  src={logoSquare} alt='Mora Designs Logo' /></a>
                <nav>
                    <p>About</p>
                    <p>Portfolio</p>
                    <p>Contact</p>
                </nav>
            </header>
        </div>
    )
}

export default Header;
